世界100ヶ国以上で発売されているエアーフレッシュナーの王様＜リトル・ツリー＞<br><br><br>★リトルツリーは香りの持続力が驚異的！★<br>気温、湿度、香りの種類によって多少の違いはありますが、<br>通常リトルツリーはパッケージを開けてから8週間香りが持続します。<br>その理由は特許を持つパッケージの密封性にあります。<br><br>類似品はパッケージの密封性が低く、流通段階で香りの成分が<br>漏れてしまうため持続力にばらつきがありますが＜リトルツリー＞は<br>パッケージを開けなければ7年間品質が変わる事がありません。<br><br><br>メーカー：バドショップ<br>品番：10967<br>香り：ピナコラーダ<style type="text/css">
